import React, { Component } from 'react'

export class Item extends Component {
  render() {
    return (
        <div className='card'>
            <img src={'./img/cards-logo/' + this.props.item.img} alt='logo' title='Casino logo'/>
            <div className='card-title'>{this.props.item.title}</div>
            <div className='card-subtitle'>{this.props.item.subtitle}</div>
            <div className='card-description'>{this.props.item.description}</div>
            <a href="{this.props.item.link}" target="_self" className='btn btn-card btn-small bg-violet'>Claime bonus</a>
        </div>

    )
  }
}

export default Item
